e: 14px; white-space: normal; background-color: rgb(255, 255, 255);"><span style="word-wrap: break-word; background-color: rgb(255, 237, 196);"><span style="font-family:微软雅黑, &amp;quot;;word-wrap: break-word;"><span style="word-wrap: break-word; font-size: 13px;">有一张人员表和部门表，因为人员表只有部门的ID，怎么让查询结果显示部门名字</span></span></span></span><br style="word-wrap: break-word; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);"/><span style="color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">&nbsp; &nbsp;&nbsp;&nbsp;处理方案： 通过针对分页查询的结果集，进行循环处理处理（拓展字段）</span><br style="word-wrap: break-word; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);"/><span style="color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);">&nbsp; &nbsp;&nbsp;</span><ignore_js_op style="word-wrap: break-word; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);"><img id="aimg_14341" aid="14341" src="http://www.jeecg.org/data/attachment/forum/201703/09/102331e8jxs5ppwpld4jxz.png" zoomfile="data/attachment/forum/201703/09/102331e8jxs5ppwpld4jxz.png" file="data/attachment/forum/201703/09/102331e8jxs5ppwpld4jxz.png" class="zoom" width="600" inpost="1" alt="QQ图片20170309102300.png" title="QQ图片20170309102300.png" lazyloaded="true" _load="1" style="word-wrap: break-word; cursor: pointer;"/></ignore_js_op><span style="color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);"></span></p><ol style="word-wrap: break-word; margin-left: 10px !important; padding: 0px !important;" class=" list-paddingleft-2">